import React, { useEffect } from "react";
import Webamp from "webamp";

function App() {
  useEffect(() => {
    new Webamp({
      initialTracks: [
        {
          metaData: {
            artist: "Bohyeon",
            title: "Hello World Theme",
          },
          url: "https://cdn.jsdelivr.net/gh/captbaritone/webamp@master/mp3/hello.mp3", // example track
          duration: 5.322286,
        },
      ],
    }).renderWhenReady(document.getElementById("winamp-container"));
  }, []);

  return (
    <div style={{ padding: 20 }}>
      <div className="window" style={{ maxWidth: "720px", margin: "0 auto" }}>
        <div className="title-bar">
          <div className="title-bar-text">Hi I'm Bohyeon &lt;3</div>
          <div className="title-bar-controls">
            <button aria-label="Minimize"></button>
            <button aria-label="Maximize"></button>
            <button aria-label="Close"></button>
          </div>
        </div>
        <div className="window-body">
          <p><strong>ðŸ’¾ Retro Portfolio Site</strong></p>
          <p>Styled with win95.css + powered by Webamp ðŸŽ¶</p>
          <hr />
          <h3>Projects</h3>
          <ul>
            <li><strong>WSS Estimation Kernel Module</strong></li>
            <li><strong>RPi5 GitOps Cluster</strong></li>
          </ul>
          <hr />
          <div id="winamp-container"></div>
        </div>
      </div>
    </div>
  );
}

export default App;
